import React, { useState } from "react";
import { Button, Col, Container, Form, Row } from "react-bootstrap";
// import { configDotenv } from "dotenv";
import axios from "axios";
function HomePage() {
  const [form, setForm] = useState("");
  const [response, setResponse] = useState([]);
  const handleForm = async (e) => {

    e.preventDefault();
    try {
      const res = await axios.get(`http://20.244.26.144/test/${form}`);
      setResponse(res.data.numbers);
      console.log("received ");
      console.log(res.data.numbers);
    } catch (e) {
      console.log(e);
    }
  };
  return (
    <div>
      <>
        <Container className="my-4">
          <Row>
            <Col md="5">
              <Form onSubmit={handleForm}>
                <Form.Select
                  value={form}
                  onChange={(e) => setForm(e.target.value)}
                >
                  <option value="prime">prime</option>
                  <option value="fibo">Fibonacci</option>
                  <option value="rand">prime</option>
                  <option value="even">prime</option>
                </Form.Select>
                <Button type="submit" className="mt-3">
                  Search
                </Button>
              </Form>
            </Col>
          </Row>
          <Row>
            <Col md="5"></Col>
          </Row>
        </Container>
      </>
    </div>
  );
}

export default HomePage;
